    /** Division by zero. */
    DIV_BY_ZERO = '#DIV/0!',

    /** Function error. */
    NAME = '#NAME?',
    VALUE = '#VALUE!',
    NUM = '#NUM!',
    NA = '#N/A',

    /** Cyclic dependency. */
    CYCLE = '#CYCLE!',

    /** Wrong reference. */
    REF = '#REF!',

    /** Array spill error. */
    SPILL = '#SPILL!',

    /** Calculation error. */
    CALC = '#CALC!',

    /** Generic error */
    ERROR = '#ERROR!',

    /** connected to remote */
    CONNECT = '#GETTING_DATA',

    /** In the case of SUM(B1 C1), */
    NULL = '#NULL!',
}

export const ERROR_TYPE_SET = new Set(Object.values(ErrorType));

