export function getCellValue(cell: Nullable<ICellData>) {
    if (cell === null) {
        return 0;
    }

    if (cell?.p) {
        const body = cell?.p.body;

        if (body == null) {
            return 0;
        }

        const data = body.dataStream;
        const newDataStream = BuildTextUtils.transform.getPlainText(data);

        return newDataStream;
    }

    return cell?.v || 0;
}

