export function getRuntimeFeatureCell(row: number, column: number, sheetId: string, unitId: string, runtimeFeatureCellData: { [featureId: string]: IRuntimeUnitDataType }) {
    const featureKeys = Object.keys(runtimeFeatureCellData);

    for (const featureId of featureKeys) {
        const data = runtimeFeatureCellData[featureId];
        const CellData = data?.[unitId]?.[sheetId];
        if (CellData == null) {
            continue;
        }

        const value = CellData.getValue(row, column);

        if (value == null) {
            continue;
        }

        return value;
    }
}

